import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { Card, Fieldset, Label, Input, ErrorMessage } from '../components/ui';
import displayAmount from '../utils/displayAmount';
import axiosRequest from '../utils/axiosRequest';
import displayDate from '../utils/displayDate';
import Modal from '../components/Modal';
import { useHistory } from 'react-router-dom';
import { Td, Th, Tbody, Table, Tr } from '../components/ui/table';

interface UncapturedPayment {
  id: string;
  amount: number;
  client_secret: string;
  created: number;
  metadata: any;
  description: string;
}

const Uncaptured: React.FC = () => {
  const [uncapturedPayments, setUncapturedPayments] = useState<
    UncapturedPayment[]
  >([]);
  const [captureModalOpen, setCaptureModalOpen] = useState(false);
  const [cancelModalOpen, setCancelModalOpen] = useState(false);
  const [currentId, setCurrentId] = useState('');
  const [amount, setAmount] = useState('');
  const [error, setError] = useState('');

  // Initial get of uncaptured transctions, refreshes on modal close
  useEffect(() => {
    const getUncaptured = async () => {
      const result = await axiosRequest(
        'get',
        (process.env.API_URL + '/paymentintent/uncaptured') as string,
        null
      );
      console.log(result.data.payments);
      setUncapturedPayments(result.data.payments);
    };
    try {
      getUncaptured();
    } catch (err) {
      console.log(err);
    }
  }, [captureModalOpen, cancelModalOpen]);

  // Cancel payment
  const cancelPayment = async () => {
    try {
      const result = await axiosRequest(
        'delete',
        (process.env.API_URL + '/paymentintent/' + currentId) as string,
        null
      );
      console.log('RESULT: ', result);
      if (result.error || result.data.error)
        throw new Error(result.error || result.data.error);

      setCancelModalOpen(false);
    } catch (err) {
      console.log('Err:', err.message);
      setError(err.message);
    }
  };

  // Capture payment
  const capturePayment = async (amount: string) => {
    const integerAmount = parseFloat(amount) * 100;

    try {
      const result = await axiosRequest(
        'post',
        (process.env.API_URL +
          '/paymentintent/' +
          currentId +
          '/capture') as string,
        { amountToCapture: integerAmount }
      );
      console.log('RESULT: ', result);
      if (result.error || result.data.error)
        throw new Error(result.error || result.data.error);

      setCaptureModalOpen(false);
    } catch (err) {
      console.log('Err:', err.message);
      setError(err.message);
    }
  };

  const handleAmountChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setAmount(e.target.value);
  };

  const renderRows = () => {
    if (!uncapturedPayments) return;
    return uncapturedPayments.map(row => (
      <Tr key={row.id}>
        <TdAmount>{displayAmount(row.amount)}</TdAmount>
        <Td>{row.metadata.customerName}</Td>
        <Td>{row.description}</Td>
        <Td>{displayDate(row.created)}</Td>
        <TdAction>
          <CaptureButton
            onClick={() => {
              setCurrentId(row.id);
              setCaptureModalOpen(true);
            }}
          >
            CAPTURE
          </CaptureButton>
          <VoidButton
            onClick={() => {
              setCurrentId(row.id);
              setCancelModalOpen(true);
            }}
          >
            CANCEL
          </VoidButton>
        </TdAction>
      </Tr>
    ));
  };

  return (
    <Card>
      <Table>
        <thead>
          <Tr>
            <ThAmount>AMOUNT</ThAmount>
            <Th>CUSTOMER</Th>
            <Th>DESCRIPTION</Th>
            <ThDate>DATE</ThDate>
            <ThAction>ACTION</ThAction>
          </Tr>
        </thead>
        <tbody>{renderRows()}</tbody>
      </Table>
      {captureModalOpen && (
        <Modal>
          <Fieldset>
            <Label>Amount to Capture</Label>
            <Input
              type="number"
              step=".01"
              value={amount}
              onChange={handleAmountChange}
            />
          </Fieldset>
          {error && <ErrorMessage>{error}</ErrorMessage>}
          <ModalButtons>
            <CancelButton onClick={() => setCaptureModalOpen(false)}>
              CANCEL
            </CancelButton>
            <ContinueButton onClick={() => capturePayment(amount)}>
              CAPTURE
            </ContinueButton>
          </ModalButtons>
        </Modal>
      )}
      {cancelModalOpen && (
        <Modal>
          <div>Are you sure you want to cancel the payment?</div>
          <ModalButtons>
            <CancelButton onClick={() => setCancelModalOpen(false)}>
              NO
            </CancelButton>
            <ContinueButton onClick={cancelPayment}>YES</ContinueButton>
          </ModalButtons>
        </Modal>
      )}
    </Card>
  );
};

export default Uncaptured;

const ThAction = styled(Th)`
  width: 15%;
`;

const ThDate = styled(Th)`
  width: 15%;
  min-width: 250px;
`;

const ThAmount = styled(Th)`
  width: 10%;
  text-align: right;
  min-width: 150px;
`;

const TdAction = styled(Td)`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 0.5rem;
  min-width: 250px;
`;

const TdAmount = styled(Td)`
  text-align: right;
`;

const ActionButton = styled.button`
  font-size: 0.7rem;
  color: white;
  border: none;
  padding: 0.3rem;
  border-radius: 2px;
  cursor: pointer;
`;

const CaptureButton = styled(ActionButton)`
  background: #60a774;

  :hover {
    background: #80c593;
  }
`;

const VoidButton = styled(ActionButton)`
  background-color: #ce5868;

  :hover {
    background: #e67584;
  }
`;

const ContinueButton = styled(ActionButton)`
  background: var(--themePrimary);
  color: var(--neutralDark);

  :hover {
    background: var(--themeSecondary);
  }
`;

const CancelButton = styled(ActionButton)`
  background: transparent;
  border: 1px solid var(--textPrimary);
  color: var(--textPrimary);

  :hover {
    background: #6d6d6d;
  }
`;

const ModalButtons = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 0.5rem;
  margin-top: 1rem;
  width: 250px;
`;
